import React from "react";
import Register from "./Register";
import Login from "./Login";

function Form() {
  return (
    <form className="form">
      <Form
        type="text"
        placeholder="Username"
      />
      <Form
        type="password"
        placeholder="Password"
      />
      <Form
        type="password"
        placeholder="Confirm-Password"
      />
      <Login
        type="text"
        placeholder="Username"
      />
      <Login
        type="password"
        placeholder="Password"
      />
    </form>
  );
}

export default Form;
